import React from "react"; 
import { Link } from "react-router-dom"

const MenuActividades = () => {
    return(
        <nav>
            <li><span>Componentes Link</span>
                <Link to="/src">Campismo</Link>
                <Link to="/escalada">Escalada</Link>
                <Link to="/rappel">Rappel</Link> 
            </li>            
        </nav>
    );
};

export default MenuActividades;
